window.bookSummaryJSON = "<p><b>My family is at war. With the Cartel and Bratva closing in on us, we need to make allies, fast.</b></p> <p>Our solution? Marrying me off to a pretty little Mafia princess.</p> <p>I'm expecting her to be a sweet, sheltered girl without a backbone like so many of the other women who grew up in our world.</p> <p>But looks can be deceiving, and it turns out my wife isn't exactly what she seems...</p> <p><i>This is an arranged marriage, dark mafia romance told in dual POV and has no cheating and a HEA. This is book one in a series of three interconnected standalones, each of which features one of the Romano brothers. Contains mature content. A complete list of content warnings can be found on the author's website.</i></p>"; 
